 import React from 'react';
import { Navbar, Nav, NavItem, Button } from 'react-bootstrap';
import logo from '../assets/msm_logo.png';
import studentlogo from '../assets/studentlogo.svg';
import $ from 'jquery';

export default props => {
    $('.canvas-toggle').hide();

    function sideNav() {
   
      if ($(window).width() <= 1133) {
   
        $('.sidebar').hide();
      } else {
   
        $('.sidebar').show();
      }
   
    }
   
    $('.canvas-toggle').click(function() {
      
    });
   
   
    $(window).resize(function() {
   
      sideNav();
   
    });
    return (
        <Nav>
        <aside class='sidebar'>
        <img
                        src={logo}
                        width="45"
                        height="30"
                        className="d-inline-block align-top "
                        alt="MSM Logo"
                        />
          <div class='main-nav'>
            <ul>
           
              <li>
                <a>Dashboard</a>
                <i class='fa fa-home'></i>
              </li>
              <li>
                <a>Students</a>
                <i class='fa fa-cog'></i>
              </li>
              <li>
                <a>Teachers</a>
                <i class='fa fa-clipboard'></i>
              </li>
              <li>
                <a>Parents</a>
                <i class='fa fa-rocket'></i>
              </li>
              <li>
                <a>Schedules</a>
                <i class='fa fa-pencil'></i>
              </li>
              <li>
                <a>Transportation</a>
                <i class='fa fa-cog'></i>
              </li>
            </ul>
          </div>
        </aside>
      </Nav>
    );
};
